/** @format */

const questions = [
  {
    id: 1,
    title: "Quel est le frameWorks avec lequel tu te sens le plus à l'aise ?",
    info: "ReactJs, mais j'adhère aussi à tous ce qui contient du javascript.",
  },
  {
    id: 2,
    title: 'Quelles sont tes motivations en tant que Développeur ?',
    info: "Me sentir un peu plus qu'utile, savoir développer un site complet !",
  },
  {
    id: 3,
    title: 'Ce qui te plaît aujourd’hui dans ta société ?',
    info: "Faire preuve d'innovation pour développer des bannières publicitaires, travailler pour des grandes enseignes tel que, Renault, Leroy Merlin, Parions-Sport, OuiSncf et d'autres.",
  },
  {
    id: 4,
    title: "Combien d'années d'ancienneté possèdes-tu ?",
    info: '2 ans et demie.',
  },
  {
    id: 5,
    title: 'Serais-tu interresser pour faire du back-end ?',
    info: "Oui, je pense notamment à NOdeJS, mais je reste ouvert à d'autres pratiques, languages ou frameworks.",
  },
];
export default questions;
